// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

contract Institute {
    address admin = 0xB02B95024cd1b2F12083A338f863027c307A3AC7;
    mapping(address => bool) private isAuthorized;
    mapping(address => string) private passwords;
    mapping(address => string) private emails;
    mapping(address => string) private roles;

    constructor() {
        // Donner l'autorisation  l'adresse admin
        isAuthorized[admin] = true;
        passwords[admin] = "8c6976e5b5410415bde908bd4dee15dfb167a9c873fc4bb8a81f6f2ab448a918";       
        emails[admin] = "admin@example.com";
        roles[admin] = "admin";
    }

    struct InstituteData {  // Renamed the struct to avoid shadowing
        address adresseEthereum;
        string ref;
        string name;
        string emailOff;
        string emailValid;
        bool autorisation;
    }

    struct ComptesInstitute {
        string email;
        string pass;
        string role;
    }

    struct Diploma {
        string instituteId;
        string diplomaReference;
        string studentId;
        string mention;
        string numCIN;
        string ipfsHash;
        string diplomaid;
        string status;
    }

    InstituteData[] public institutes;
    uint256 public instituteCount = 0;
    uint256 public ConferenceCount = 0;
    mapping(address => ComptesInstitute[2]) public compteInst;
    mapping(address => Diploma[]) private instituteToDiplomas;
    mapping(string => Diploma) public DiplomasById;
    mapping(string => Diploma) public DiplomaByCin;
    mapping(address => string[]) public diplomasNamesByAddress;
    mapping(address => string[]) public diplomasRefsByAddress;
    mapping(address => string[]) public namesByAddress;
    mapping(address => string[]) public emailsByAddress;
    mapping(address => string[]) public birthsByAddress;
    mapping(address => string[]) public mentionsByAddress;
    mapping(address => string[]) public diplomatedByAddress;
    mapping(address => string[]) public cinsByAddress;
    mapping(address => string[]) public diplomarefsByAddress;
    mapping(address => string[]) public hashsByAddress;
    mapping(address => string[]) public idsByAddress;

    event InstituteAlreadyExists(address indexed _adresseEthereum);
    event RefAlreadyExists(string indexed _ref);
    event InstituteCredentialsUpdated(string indexed _email, string _newPassword);

    function addInstitute(
        address _adresseEthereum,
        string memory _ref,
        string memory _name,
        string memory _emailOff,
        string memory _emailValid
    ) public {
        bool adderExists = false;
        bool refExists = false;
        for (uint i = 0; i < institutes.length; i++) {
            if (institutes[i].adresseEthereum == _adresseEthereum) {
                adderExists = true;
                emit InstituteAlreadyExists(_adresseEthereum);
                break;
            }
            if (keccak256(bytes(institutes[i].ref)) == keccak256(bytes(_ref))) {
                refExists = true;
                emit RefAlreadyExists(_ref);
                break;
            }
        }
        require(!adderExists, "Institute address already exists");
        require(!refExists, "Institute ref already exists");

        institutes.push(InstituteData(
            _adresseEthereum,
            _ref,
            _name,
            _emailOff,
            _emailValid,
            true
        ));
        instituteCount++;
        string memory hashedPassword = string(abi.encodePacked("institute"));
        compteInst[_adresseEthereum][0] = ComptesInstitute(_emailOff, hashedPassword, "officier");
        compteInst[_adresseEthereum][1] = ComptesInstitute(_emailValid, hashedPassword, "validator");
        roles[_adresseEthereum] = "institute";
    }

    function getInstituteByEmail(string memory _email) public view returns (
        address,
        string memory,
        string memory,
        string memory,
        string memory,
        bool
    ) {
        for (uint i = 0; i < institutes.length; i++) {
            if (keccak256(bytes(institutes[i].emailOff)) == keccak256(bytes(_email)) ||
                keccak256(bytes(institutes[i].emailValid)) == keccak256(bytes(_email))) {
                InstituteData memory institute = institutes[i];
                return (
                    institute.adresseEthereum,
                    institute.ref,
                    institute.name,
                    institute.emailOff,
                    institute.emailValid,
                    institute.autorisation
                );
            }
        }
        revert("Institute not found");
    }

    function checkAuthorization(string memory email, string memory passwordHash) public view returns (bool) {
        if (!isAuthorized[msg.sender]) {
            return false;
        }
        string storage storedPasswordHash = passwords[msg.sender];
        bool passwordMatches = keccak256(bytes(passwordHash)) == keccak256(bytes(storedPasswordHash));
        if (!passwordMatches) {
            return false;
        }
        string storage storedEmail = emails[msg.sender];
        bool emailMatches = keccak256(bytes(email)) == keccak256(bytes(storedEmail));
        if (!emailMatches) {
            return false;
        }
        return true;
    }

    function getInstituteCount() public view returns (uint256) {
        return institutes.length;
    }

    function getInstitutes() public view returns (InstituteData[] memory) {
        return institutes;
    }

    function getMyInstitute() public view returns (
        address, string memory,  string memory, string memory,
        string memory, bool
    ) {
        address myAddress = msg.sender;
        for (uint i = 0; i < institutes.length; i++) {
            if (institutes[i].adresseEthereum == myAddress) {
                InstituteData memory inst = institutes[i];
                return (
                    inst.adresseEthereum, inst.ref, inst.name, inst.emailOff,
                    inst.emailValid, inst.autorisation
                );
            }
        }
        revert("Institute doesn't exist!");
    }

    function findInstitute(address _adresseEthereum) public view returns (int256) {
        for (uint i = 0; i < instituteCount; i++) {
            if (_adresseEthereum == institutes[i].adresseEthereum)
                return int256(i);
        }
        return -1;
    }

    function findInstRef(string memory _ref) public view returns (int256) {
        for (uint i = 0; i < instituteCount; i++) {
            if (keccak256(bytes(_ref)) == keccak256(bytes(institutes[i].ref)))
                return int256(i);
        }
        return -1;
    }

    function getInstituteAddressByEmail(string memory _email) public view returns (address) {
        for (uint i = 0; i < institutes.length; i++) {
            if ((keccak256(bytes(compteInst[institutes[i].adresseEthereum][0].email)) == keccak256(bytes(_email))) ||
                (keccak256(bytes(compteInst[institutes[i].adresseEthereum][1].email)) == keccak256(bytes(_email)))) {
                return institutes[i].adresseEthereum;
            }
        }
        return address(0);
    }

    function resetInstitutePassword(string memory email, string memory newPassword) public {
        string memory hashedNewPassword = string(abi.encodePacked(newPassword));
        if (keccak256(bytes(compteInst[msg.sender][0].email)) == keccak256(bytes(email))) {
            compteInst[msg.sender][0].pass = hashedNewPassword;
        } else if (keccak256(bytes(compteInst[msg.sender][1].email)) == keccak256(bytes(email))) {
            compteInst[msg.sender][1].pass = hashedNewPassword;
        }
        emit InstituteCredentialsUpdated(email, newPassword);
    }

    function authorizedInstitute(string memory email, string memory password) public view returns (string memory) {
        string memory hashedPassword = string(abi.encodePacked(password));
        address instituteAddress = getInstituteAddressByEmail(email);
        if (instituteAddress == msg.sender &&
            keccak256(bytes(compteInst[instituteAddress][0].pass)) == keccak256(bytes(hashedPassword)) &&
            keccak256(bytes(compteInst[instituteAddress][0].email)) == keccak256(bytes(email))) {
            return compteInst[instituteAddress][0].role;
        } else if (instituteAddress == msg.sender &&
            keccak256(bytes(compteInst[instituteAddress][1].pass)) == keccak256(bytes(hashedPassword)) &&
            keccak256(bytes(compteInst[instituteAddress][1].email)) == keccak256(bytes(email))) {
            return compteInst[instituteAddress][1].role;
        } else {
            return "false";
        }
    }

    function updateInstituteCredentials(string memory email, string memory oldPassword, string memory newPassword) public {
        require(
            keccak256(bytes(authorizedInstitute(email, oldPassword))) != keccak256(bytes("false")),
            "ne peut pas acceder"
        );
        string memory hashedNewPassword = string(abi.encodePacked(newPassword));
        if (keccak256(bytes(compteInst[msg.sender][0].email)) == keccak256(bytes(email))) {
            compteInst[msg.sender][0].pass = hashedNewPassword;
        } else if (keccak256(bytes(compteInst[msg.sender][1].email)) == keccak256(bytes(email))) {
            compteInst[msg.sender][1].pass = hashedNewPassword;
        }
    }

    function addDiploma(
        address _instituteAddress,
        string memory _diplomaReference,
        string memory _instituteId,
        string memory _studentId,
        string memory _mention,
        string memory _numCIN,
        string memory _ipfsHash,
        string memory _diplomaId
    ) public {
        Diploma memory newDiploma = Diploma({
            diplomaReference: _diplomaReference,
            instituteId: _instituteId,
            studentId: _studentId,
            mention: _mention,
            numCIN: _numCIN,
            ipfsHash: _ipfsHash,
            diplomaid: _diplomaId,
            status: "Pending"
        });
        instituteToDiplomas[_instituteAddress].push(newDiploma);
        DiplomasById[_diplomaId] = newDiploma;
        DiplomaByCin[_numCIN] = newDiploma;
    }

    function addDiplomas(
        address _instituteAddress,
        string memory _instituteId,
        string memory _diplomaReference,
        string[] memory _studentIds,
        string[] memory _mentions,
        string[] memory _numCINs,
        string[] memory _ipfsHashes,
        string[] memory _diplomaIds
    ) public {
        for (uint i = 0; i < _studentIds.length; i++) {
            instituteToDiplomas[_instituteAddress].push(
                Diploma(
                    _instituteId,
                    _diplomaReference,
                    _studentIds[i],
                    _mentions[i],
                    _numCINs[i],
                    _ipfsHashes[i],
                    _diplomaIds[i],
                    "Pending"
                )
            );
            DiplomasById[_diplomaIds[i]] = Diploma(
                _instituteId,
                _diplomaReference,
                _studentIds[i],
                _mentions[i],
                _numCINs[i],
                _ipfsHashes[i],
                _diplomaIds[i],
                "Pending"
            );
            DiplomaByCin[_numCINs[i]] = Diploma(
                _instituteId,
                _diplomaReference,
                _studentIds[i],
                _mentions[i],
                _numCINs[i],
                _ipfsHashes[i],
                _diplomaIds[i],
                "Pending"
            );
        }
    }

    function getDiplomasForInstitute(address _instituteAddress) public view returns (Diploma[] memory) {
        return instituteToDiplomas[_instituteAddress];
    }

    function getDiplomaById(string memory _diplomaId) public view returns (Diploma memory) {
        return DiplomasById[_diplomaId];
    }

    function getDiplomaByCin(string memory _numCIN) public view returns (Diploma memory) {
        return DiplomaByCin[_numCIN];
    }

    function setDiplomaStatus(string memory _numCIN, string memory _ID, string memory _status) public {
        DiplomaByCin[_numCIN].status = _status;
        DiplomasById[_ID].status = _status;
        Diploma[] storage diplomas = instituteToDiplomas[msg.sender];
        for (uint256 i = 0; i < diplomas.length; i++) {
            if (keccak256(bytes(diplomas[i].numCIN)) == keccak256(bytes(_numCIN))) {
                instituteToDiplomas[msg.sender][i].status = _status;
            }
        }
    }
     function getAllDiplomas() public view returns (Diploma[] memory) {
        uint totalDiplomas = 0;
        for (uint i = 0; i < institutes.length; i++) {
            totalDiplomas += instituteToDiplomas[institutes[i].adresseEthereum].length;
        }

        Diploma[] memory allDiplomas = new Diploma[](totalDiplomas);
        uint index = 0;
        for (uint i = 0; i < institutes.length; i++) {
            Diploma[] storage diplomas = instituteToDiplomas[institutes[i].adresseEthereum];
            for (uint j = 0; j < diplomas.length; j++) {
                allDiplomas[index] = diplomas[j];
                index++;
            }
        }

        return allDiplomas;
    }
}
